interface IntegerStack{
	public Integer push(Integer item);
	public Integer pop();
	public Integer peek();
	public boolean empty();
	public int size();
}

class ArrayListIntegerStack implements IntegerStack{
	ArrayList<Integer> list = new ArrayList<Integer>();

	public String toString(){
		return list.toString();
	}

	public Integer push(Integer item){
		if(item == null)
			return null;
		else{
			list.add(item);
			return item;
		}
	}

	public Integer pop(){
		if(list.size() == 0)
			return null;
		else{
			Integer item = list.lastIndexOf(item);
			list.remove(item);
			return item;
		}
	}

	public Integer peek(){
		if(list.size() == 0)
			return null;
		else
			return list.lastIndexOf(item);
	}

	public boolean empty(){
		if(list.size() == 0)
			return true;
		else
			return false;
	}

	public int size(){
		return list.size();
	}
}

